import React from 'react';
import Button from './Button';
import Input from './input'


export default function Login() {
    return (
        <div>
  
            <Input 
            onChange={(e)=> console.log(e.target.value)}
            placeHolderKeyword="email" 
            type="email"
            label="Your email"
            />
            <Input 
            onChange={(e)=> console.log(e.target.value)}
            placeHolderKeyword="Your Password" 
            type="password"
            label=" password"
            />
            <Button text="Login"/>
        </div>
    )
}
